void dumpMat(vector< vector<int> > mat, string info ){
    cout << "info:" << info << endl;
    for(int i=0; i<mat.size(); i++ ){
        cout << i << ": " ;
        for(int j=0; j<mat[i].size(); j++){
            cout << mat[i][j] << " ";
        }
        cout << endl;
    }
    cout << endl;
}


int getoffset(int i, int j,int size){
    return i*size + j;
}
int geti(int val, int size){
    return val/size;
}
int getj(int val, int size){
    return val%size;
}
bool isMarked(map<string,bool> *mp, string val){
    map<string,bool>::iterator it = mp->find(val);
    if( it == mp->end() ){
        return false;
    }
    return true;
}

int find0_bfs(const vector<vector<int> >& matrix, int fi, int fj){
    int size = matrix.size();
    queue<int> que;
    que.push( getoffset(fi,fj,size) );
    map<string,bool> mark;

    while(!que.empty()){
        int p = que.front();
        int nowi = geti(p,size);
        int nowj = getj(p,size);

        stringstream stream;
        stream << p;
        string pstr = stream.str();

        que.pop();
        if(isMarked(&mark, pstr)){
            //cout << "check continue :" << geti(p) <<":"<<getj(p)<< ", for ("<< fi<<":"<<fj<<")"<<endl;
            continue;
        }
        //cout << "check:" << geti(p) <<":"<<getj(p)<< ", for ("<< fi<<":"<<fj<<")"<<endl;
        mark[pstr] = true;
        if( matrix[nowi][nowj] == 0 ){
            //cout << "find:" << nowi <<":"<< nowj << ", for ("<< fi<<":"<<fj<<")"<<endl;
            int diff = abs(nowi -fi) + abs(nowj-fj);
            return diff;
        }
        //up
        if(nowi>0){
            //cout << "push up:" << nowi-1 << ":"<<nowj<<endl;
            que.push( getoffset(nowi-1,nowj,size) );
        }

        //down
        if(nowi<size-1){
            //cout << "push down:" << nowi+1<<":"<<nowj<<endl;
            que.push(getoffset(nowi+1, nowj,size));
        }
        //left
        if(nowj>0){
            //cout << "push left:" << nowi<<":"<<nowj-1<<endl;
            que.push(getoffset(nowi, nowj-1,size));
        }
        //right
        if(nowj<size-1){
            //cout << "push right:" << nowi<<":"<<nowj+1<<endl;
            que.push(getoffset(nowi, nowj+1, size));
        }
    }
    return 100;
}

vector<vector<int> > updateMatrix(vector<vector<int> >& matrix) {
    //backup matrix
    vector<vector<int> > matrix_bk;
    for(int i=0;i<matrix.size();i++){
        vector<int> elem = matrix[i];
        vector<int> add;
        for(int j=0;j<elem.size();j++){
            add.push_back(elem[j]);
        }
        matrix_bk.push_back(add);
    }

    for(int i=0; i<matrix_bk.size(); i++){
        vector<int> elem = matrix_bk[i];
        for(int j=0; j<elem.size();j++){
            if( elem[j] == 0 ){
                matrix[i][j] = 0;
                continue;
            }

            int ret= find0_bfs(matrix_bk, i,j );
            matrix[i][j] = ret;
        }
    }
    return matrix;
}

